  }

  useEffect(() => {
    fetch
      (
        "http://192.168.15.10:3200/api/admin/getAllUsers",
        {
          method:'GET',
          mode: 'no-cors',
        }
      )
      .then(res => res.json())
      .then(
        (result) => {
          addResult(result)
          setIsLoaded(true);

        },
        (error) => {
          setIsLoaded(true);
          setError(error);
        }
      )
  }, [])

  function Content(){
    {if(!isLoaded){
      <h1>Carregando</h1>
    }else{
      <GridContainer>
      <GridItem xs={12} sm={12} md={12}>
        <Card plain>
          <CardHeader plain color="primary">
            <h4 className={classes.cardTitleWhite}>
              Lista de Usu√°rios
            </h4>
            <p className={classes.cardCategoryWhite}>
              Filtre por tipo de usu√°rio e localiza√ß√£o.
            </p>
          </CardHeader>
          <CardBody>
            <Table
              tableHeaderColor="primary"
              tableHead={["ID", "Nome", "Tipo De Perfil", "Cidade", "Estado", "Quantidade de Links"]}
              // tableData={[
              //   ["149ye9ee9ee", "Teste", "2", "teste", "teste", "2"],

              // ]}
              tableData={teste}
            />
          </CardBody>
        </Card>
      </GridItem>
    </GridContainer>
    }}
  }

  return (
    <Content/>
  );
}
